import React, { Fragment } from 'react';

const colors = () => {
  return (
    <Fragment>
      <div className='container'>
        <h1>
          <i className='fas fa-exclamation-triangle'></i> Random Color!
        </h1>
        <h5>Sorry, this hasn't been implemented yet.</h5>
      </div>
    </Fragment>
  );
};

export default colors;
